import React from 'react';
import SearchBar from './SearchBar';


class App extends React.Component {

    onSearchSubmit(input){
        console.log(input)
    }

    render(){
        return (
            <div className="ui container" style={{ marginTop: '50px' }}>
                <SearchBar onSubmit={this.onSearchSubmit}/>
            </div>
        )
    }
}






export default App;
